import "react-resizable/css/styles.css";

export const GridItem = ({ key, title, text }) => {
  return (
    <GridLayout className="layout" layout={layout} cols={12} width={1200} isResizable={false} draggableHandle=".draggable-handle">
      <div key="b" className="bg-white border border-gray-300 flex items-center justify-center text-lg">
        <span className="draggable-handle cursor-move p-2">B</span>
      </div>
    </GridLayout>
  );
};

export const GridItemWithImage = ({ key, title, text, image, alt }) => {
  return (
    <div key={key} className="bg-white border border-gray-300 flex items-center justify-center text-lg draggable-handle cursor-pointer">
      <img src={image} alt={alt} className="mb-2" />
      <h5>{title}</h5>
      <span className="p-2">{text}</span>
    </div>
  );
};
